import React from 'react';

const ShareIcon = ({ className, width = 20, height = 20 }) => (
  <svg 
    className={`share-icon ${className || ''}`}
    width={width}
    height={height}
    viewBox="0 0 20 20"
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
  >
    <circle cx="15" cy="5" r="2" stroke="currentColor" strokeWidth="1.5"/>
    <circle cx="5" cy="10" r="2" stroke="currentColor" strokeWidth="1.5"/>
    <circle cx="15" cy="15" r="2" stroke="currentColor" strokeWidth="1.5"/>
    <path d="M7 10l6-3M7 10l6 3" stroke="currentColor" strokeWidth="1.5"/>
  </svg>
);

export default ShareIcon;
